import React from 'react'
import styled from 'styled-components'

const TitleText = styled.h2`
    font-size: 30px;
`;

const MainBox = styled.div`

    background-color: aqua;
    height: 400px;
    width: 880px;
    margin: 10px;
    border-radius: 5px;
`;


export default function index() {
  return (
    <div>
        <MainBox>

        </MainBox>
    </div>
  )
}
